def generate_palette(primary_color):
    # Convertir el color primario de hexadecimal a RGB
    primary_rgb = tuple(int(primary_color[i:i+2], 16) / 255.0 for i in (1, 3, 5))

    # Definir los colores secundarios y auxiliares basados en el color primario
    secondary_rgb = tuple((1 - (c - 0.5)) for c in primary_rgb)
    third_rgb = (0, 0, 0)  # Negro
    aux_rgb = tuple((c + 0.1) for c in primary_rgb)
    second_aux_rgb = tuple(int(primary_color[i:i+2], 16) / 255.0 for i in (1, 3, 5))  # Usar el color primario

    # Definir los colores de contraste
    contrast_primary_rgb = (1, 1, 1) if sum(primary_rgb) < 1.5 else (0, 0, 0)
    contrast_secondary_rgb = second_aux_rgb
    contrast_third_rgb = (1, 1, 1) if sum(third_rgb) < 1.5 else (0, 0, 0)
    contrast_aux_rgb = primary_rgb
    contrast_second_aux_rgb = secondary_rgb

    # Convertir los colores RGB a hexadecimal
    def rgb_to_hex(rgb):
        return ''.join(format(int(c * 255), '02x') for c in rgb)

    secondary_color = rgb_to_hex(secondary_rgb)
    third_color = rgb_to_hex(third_rgb)
    aux_color = rgb_to_hex(aux_rgb)
    second_aux_color = rgb_to_hex(second_aux_rgb)
    contrast_primary_color = rgb_to_hex(contrast_primary_rgb)
    contrast_secondary_color = rgb_to_hex(contrast_secondary_rgb)
    contrast_third_color = rgb_to_hex(contrast_third_rgb)
    contrast_aux_color = rgb_to_hex(contrast_aux_rgb)
    contrast_second_aux_color = rgb_to_hex(contrast_second_aux_rgb)

    # Devolver la paleta de colores como un diccionario
    return {
        'primary_color': primary_color.lstrip('#').upper(),  # Convertir a mayúsculas
        'secondary_color': secondary_color.lstrip('#').upper(),
        'third_color': third_color.lstrip('#').upper(),
        'aux_color': aux_color.lstrip('#').upper(),
        'second_aux_color': second_aux_color.lstrip('#').upper(),
        'contrast_primary_color': contrast_primary_color.lstrip('#').upper(),
        'contrast_secondary_color': contrast_secondary_color.lstrip('#').upper(),
        'contrast_third_color': contrast_third_color.lstrip('#').upper(),
        'contrast_aux_color': contrast_aux_color.lstrip('#').upper(),
        'contrast_second_aux_color': contrast_second_aux_color.lstrip('#').upper()
    }

def generate_objective_circle(color_circle, color_text, text):
    # Tamaño del círculo en centímetros
    diametro_cm = 0.825

    # Resolución deseada en píxeles por pulgada (PPI)
    ppi = 300  # Por ejemplo, 300 PPI para una buena calidad de impresión

    # Convertir el tamaño del círculo de centímetros a píxeles
    radio_px = int(diametro_cm * ppi / 2.54)
    diametro_px = radio_px * 2

    # Crea una nueva imagen con fondo transparente y alta resolución
    imagen = Image.new('RGBA', (diametro_px, diametro_px), (255, 255, 255, 0))
    dibujo = ImageDraw.Draw(imagen)

    # Calcula el rectángulo que define el círculo
    rectangulo = [(radio_px - radio_px, radio_px - radio_px), (radio_px + radio_px, radio_px + radio_px)]

    # Convertir el color hexadecimal al formato adecuado
    color_rgb = tuple(int(color_circle[i:i+2], 16) for i in (0, 2, 4))

    # Dibuja un círculo en la imagen
    dibujo.ellipse(rectangulo, fill=color_rgb)

    # Carga la fuente Arial en negrita con tamaño 21.5
    fuente = ImageFont.truetype("ariblk.ttf", 100)

    # Dibuja el texto en el centro del círculo
    dibujo.text((30,30), text, fill=tuple(int(color_text[i:i+2], 16) for i in (0, 2, 4)), font=fuente)

    # Guarda la imagen con la resolución especificada
    filename = "{}.png".format(uuid.uuid4())
    imagen.save(filename, dpi=(ppi, ppi))

    return filename

def generate_benefit_asset(color_img, color_text, texto_completo):
    """
    Añade un texto completo a una imagen.

    Parámetros:
    - imagen: Ruta de la imagen PNG.
    - texto_completo: Texto completo que se agregará a la imagen.
    """
    # Abrir la imagen
    ppi = 300

    r = int(color_img[0:2], 16)
    g = int(color_img[2:4], 16)
    b = int(color_img[4:6], 16)

    new_color = (r, g, b)

    img = Image.open('img_beneficios.png')

    # Obtener el tamaño de la imagen
    datos_pixeles = img.load()

    ancho, alto = img.size

    for i in range(ancho):
        for j in range(alto):
            # Verificar si el píxel es blanco
            if datos_pixeles[i, j] == (255, 255, 255, 255):
                # Cambiar el color del píxel
                datos_pixeles[i, j] = new_color

    # Crear un objeto ImageDraw para dibujar en la imagen
    dibujo = ImageDraw.Draw(img)

    # Especificar la fuente y el tamaño del texto
    fuente = ImageFont.truetype("arialbd.ttf", 50)

    coordenadas = (0, 0)

    if (len(texto_completo) == 4):
        coordenadas = (17, 30)
    elif (len(texto_completo) == 3):
        coordenadas = (33, 30)
    else:
        coordenadas = (45, 30)


    # Dibujar el texto en la imagen
    dibujo.text(coordenadas, texto_completo, fill=tuple(int(color_text[i:i+2], 16) for i in (0, 2, 4)), font=fuente)

    # Guardar la imagen modificada
    filename = "{}.png".format(uuid.uuid4())
    img.save(filename, dpi=(ppi, ppi))

    return filename

def base64_to_file(base64_string):
    try:
        # Obtener la extensión del archivo desde la cadena Base64
        if base64_string.startswith('data:image/jpeg'):
            extension = 'jpg'
            base64_string = base64_string.replace('data:image/jpeg;base64,', '')
        elif base64_string.startswith('data:image/png'):
            extension = 'png'
            base64_string = base64_string.replace('data:image/png;base64,', '')
        else:
            raise ValueError("Formato de imagen no válido")
        
        # Decodificar el string Base64 para obtener los bytes
        decoded_bytes = base64.b64decode(base64_string)

        # Guardar los bytes en un archivo
        filename = "{}.{}".format(uuid.uuid4(), extension)
        with open(filename, 'wb') as f:
            f.write(decoded_bytes)
        
        return filename  # Devolver el nombre del archivo creado
    except Exception as e:
        print(f"Error al guardar el archivo: {e}")
        return None

